import "./App.css";
import Header from "./components/Header/Header";
import Navbar from "./components/Navbar/Navbar";
import Profile from "./components/Profile/Profile";
import Dialogs from "./components/Dialogs/Dialogs";
import News from "./components/News/News";
import Music from "./components/Music/Music";
import Settings from "./components/Settings/Settings";
import { BrowserRouter, Route, Routes } from "react-router-dom";

const App = (props) => {
  debugger
  return (
    <BrowserRouter>
      <div className="app-wrapper">
        <Header />
        <Navbar sidebar = {props.state.sidebar.friends}/>
        <div className="app-wpapper-content">
          <Routes>
            <Route path="/profile" element={<Profile dispatch = {props.dispatch}
            textChange = {props.state.profilePage.newPostText}
            posts={props.state.profilePage.posts}/>} />
            <Route path="/dialogs" element={<Dialogs 
            dialogs={props.state.dialogsPage.dialogs} 
            message={props.state.dialogsPage.message} 
            photo={props.state.dialogsPage.photo}
            store={props.store}/>} />
            <Route path="/news" element={<News />} />
            <Route path="/music" element={<Music />} />
            <Route path="/settings" element={<Settings />} />
          </Routes>
        </div>
      </div>
    </BrowserRouter>
  );
};

export default App;


